@geardici | Nickel5  I have a simple and effective suggestion for consideration: add an "unchanged_deadline" timestamp to the existing score table in the database.

When implementing a new scoring update, set the unchanged_deadline column for existing scores to now + 45 days (the current maximum scoring window) if this col has now value. This ensures that scores are updated only when the corresponding day_id is recalculated after the deadline.

This approach prevents scoring changes from being applied retroactively.

